import React from 'react';
import { Calendar, Row, Col, Image } from 'antd';

const Home = () => {
    return (
        <>
            <Row>
                <Col flex={2}>
                    <img src="./public/pengsu.png" />
                    <Image alt="my picture" />
                </Col>
                <Col flex={3}>abcdef</Col>
            </Row>
            <Row>
                <Calendar></Calendar>
            </Row>
        </>
    );
};

export default Home;
